Sailing on the river, approaching the kiosk was a surreal experience. The structure was briefly obscured by the foliage that grew on he banks of the island- its large columns welcoming us tourists in our boats like pilgrims who were about to enter a sacred space nestled by the holy waters of the Nile.

The Trajanâ€™s Kiosk served as the main entrance to the Philae temple complex. The structure is hypaeyhral (roofless), but sockets on the stone architraves suggest that a slightly vaulted roof structure made of timber may have been constructed during ancient times. 

It was originally on the island of Philae, but after the opening of the Lower Aswan Dam, the whole temple complex of Philae was submerged. The temple complex including the Trajanâ€™s Kiosk was then relocated to Agilika island in the 1960â€™s by UNESCO due to the rising waters of the Nile following the construction of the Aswan High Dam. 

